export function getCity(id){
    var cityList = [];
    areas.forEach(function(item){
      if(item.id == id){
        cityList.push(item);
      }
    })
    return cityList;
  }
export function getCountry(id){
    var countryList = [];
    areas.forEach(function(item){
      if(item.children != ''){
        item.children.forEach(function (children) {
          if(children.id == id){
            countryList.push(children);
          }
        })
      }
    })
    return countryList;
  }
